import React from 'react';
import Routes from './Routes';
import axios from 'axios';

axios.defaults.baseURL = 'http://localhost:9000/';

const login = () =>{

    axios.get('/tokenauth', {
      headers: {
        'x-access-token': localStorage.getItem('token')
      }
    })
    .then(res => {
      console.log(res.data);

    })
    .catch(err => {
      console.log(err);
    });
  }



function App() {
    return (
        <div>
            <Routes />
        </div>
    );
}

export default App;
